  false,\n\t\"url\": null,\n\t\"notes\": \"This web site is designed to help you obtain
  basic information about complaints filed regarding companies that do business in
  Hawaii.rnrnThe web site provides access to selected complaints that were filed with
  or initiated by RICO. Case numbers reflected in this web site relate to RICO cases.rnrnThe
  information contained in this web site DOES NOT comprise all information from official
  RICO records available to the public. For more detailed information about how cases
  are processed in RICO, go to http://hawaii.gov/dcca/rico/about.rnrnLegal Actions
  that were filed by RICO before 1986 may not be reflected on this site.\",\n\t\"license_title\":
